window.bookSummaryJSON = "<p>With the sudden disappearance of Iannis, the Chief Mage, Solantha has erupted into pandemonium. Citizens are rioting in the streets, the Mages Guild is on a misguided warpath, and shifters and humans are fleeing the city in droves. </p> <p>Ridden with guilt, Sunaya defies the Mages Guild and goes off in search of Iannis, trekking into dangerous, uncivilized territory to try and make things right. But Sunaya's relationship with Iannis isn't the only thing at stake - if she doesn't find him soon, the Resistance might just succeed in plunging the Northia Federation into a devastating and bloody civil war. </p>"; 
